            char unit = unitStr.charAt(0);

            switch (unit) {
                case 's':
                    return number * 1000;
                case 'm':
                    // if it's an m, could be 'minutes' or 'millis'. default minutes
                    if (unitStr.length() >= 2 && unitStr.charAt(1) == 's') {
                        return number;
