            throw new IOException("Cannot move directory: " + from + " to a subdirectory of itself: " + to);
        }
        copyDir(from, to);
        deleteDir(from);
        if (from.exists()) {
            throw new IOException("Failed to delete original directory '" + from + "' after copy to '" + to + '\'');
        }
    }
}

