public static long copy(final Reader input, final Writer output) throws IOException {
    final char[] buffer = new char[DEFAULT_BUFFER_SIZE];
    long count = 0;
    int n;
    while (EOF != (n = input.read(buffer))) {
        output.write(buffer, 0, n);
        count += n;
    }
    return count;
}

